import './Hero.css';

const Hero = () => {
    const handleRedirect = (url) => {
        window.open(url, '_blank', 'noopener,noreferrer');
    };

    return (
        <div className="Hero">
            
                <div className="logo-animation" onClick={() => handleRedirect('#')}>
                    <img src='/assets/animation.mp4' alt="Logo" />
                </div>
                
        </div>
    );
}

export default Hero;
